import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract product data
    const productData = await page.$$eval('.product-card', cards => 
      cards.map(card => ({
        title: card.querySelector('.product-title')?.textContent?.trim(),
        price: card.querySelector('.product-price')?.textContent?.trim(),
        rating: card.querySelector('.product-rating')?.textContent?.trim(),
        seller: card.querySelector('.seller-info')?.textContent?.trim()
      }))
    );

    // Extract navigation links
    const navLinks = await page.$$eval('a', links => 
      links.map(link => ({
        text: link.textContent?.trim(),
        href: link.getAttribute('href')
      })).filter(link => link.text && link.text.length > 0)
    );

    // Extract search categories
    const categories = await page.$$eval('.search-category option', options => 
      options.map(option => option.textContent?.trim()).filter(Boolean)
    );

    // Extract user profile links
    const profileLinks = await page.$$eval('a[href*="Profile"], a[href*="Orders"], a[href*="Wish"]', links =>
      links.map(link => link.textContent?.trim()).filter(Boolean)
    );

    // Extract button texts
    const buttons = await page.$$eval('button', buttons =>
      buttons.map(button => button.textContent?.trim()).filter(Boolean)
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted product data, navigation links, categories, and user profile information",
      extractedData: {
        products: productData,
        navigationLinks: navLinks,
        categories: categories,
        profileLinks: profileLinks,
        buttons: buttons
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
